import react, { useState, setState, useContext } from 'react';
import axios from 'axios';


function Register() {

    const [user, setUser] = useState({});

    const handleChange = e => {
        setUser({...user, [e.target.name]: e.target.value });
        //console.log(user);
    };

    const hanldeSubmit = e => {
        e.preventDefault();

        axios
                .post('http://localhost:8087/auth/register', { username: user.username , password: user.password, email: user.email })
                .then(data => {
                    console.log(data);
                    //history.push('/Menu');
                })
                .catch( e => console.log(e) );

    }

    return(
        <div>
            <br />
            <h1>Register form : </h1>
            <br />

            <form onChange={handleChange} onSubmit={hanldeSubmit}>


                <input name="username" type="text" placeholder="Username"  />
                <br/>
                <input name="email" type="email" placeholder="Email"  />
                <br/>
                <input name="password" type="password" placeholder="Password" />
                <br/>
                <input type="submit" value="Register" href="/"/>
            </form>


        </div>



    )


}

export default Register;
